import React from "react";
import { DropdownButton } from "react-bootstrap/Button";

function Drop() {
  return (
    <DropdownButton id="dropdown-basic-button" title="Dropdown button">
      <DropdownButton.Item href="#/action-1">Action</DropdownButton.Item>
      <DropdownButton.Item href="#/action-2">
        Another action
      </DropdownButton.Item>
      <DropdownButton.Item href="#/action-3">
        Something else
      </DropdownButton.Item>
    </DropdownButton>
  );
}
export default Drop;
